import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-login-requests',
  templateUrl: './login-requests.page.html',
  styleUrls: ['./login-requests.page.scss'],
})
export class LoginRequestsPage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}
<ion-header [translucent]="true">
  <ion-toolbar >
    <ion-buttons slot="start">
      <ion-button class="custom-button" expand="block"><ion-icon name="chevron-back-outline" slot="start"></ion-icon></ion-button>
    </ion-buttons>
    <ion-title>Log In Requests</ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true" class="gradient-background">
  <ion-header>
    <ion-toolbar class="header-background">
      <ion-title></ion-title>
    </ion-toolbar>
  </ion-header>

  <div id="container">
    <strong class="capitalize">1 Login Request</strong>
    <p>Check if the user trying to login is an ERU member</p>

  </div>


</ion-content>
